Aggregate count of various fields in document based off condition<p>I'm looking to be able to get certain values and get the count of how many times those values are in a collection based off which key has a certain id. For instance, here's an example of a single document from a collection of Game Logs </p>

<pre><code>{
    "_id": "5af88940b73b2936dcb6dfdb",
    "date": "2018-05-13T18:51:44.548Z",
    "playerOne": "5af888d0b73b2936dcb6dfd3",
    "playerOneThrew": "Scissors",
    "playerTwo": "5af88918b73b2936dcb6dfd7",
    "playerTwoThrew": "Rock",
    "winner": "5af88918b73b2936dcb6dfd7",
     "__v": 0
}
</code></pre>

<p>I'm looking to be able to query based off a Players ID (could be playerOne or could be playerTwo) and pull back the hand that player threw for each match. Essentially I'm looking to be able to get a total count of all hands thrown (rock, paper, scissors) for all games by Players ID. </p>

<p>Is there a way to aggregate a count for each "thrown hand" value for all documents in a collection and return something like </p>

<pre><code>{
    "player": "5af888d0b73b2936dcb6dfd3",
    "Rock": 3,
    "Paper": 6,
    "Scissors": 12
}
</code></pre>

<p>My thoughts are to set a variable based on which id matches playerOne || playerTwo then use that variable in switch statement where I aggregate the count of "rock", "paper", "scissors". Problem is I'm new to using MongoDB and I'm having difficulty understanding the proper syntax for a query like this.</p>

<p>Here's where I'm currently at </p>

<pre><code>GameLogs.aggregate(
  [
    {
      $let: {
        vars: {
          playerThrew: {
            $cond: {
              if: {
                $eq: { playerOne: id },
              }
              }, then: playerOneThrew, else: playerTwoThrew
            }
        }
      }
    },
    {
      $switch: {
        branches: [
          { case: { $eq: 'Rock' }, then: { $count: 'Rock' } },
          { case: { $eq: 'Paper' }, then: { $count: 'Paper' } },
          { case: { $eq: 'Scissors' }, then: { $count: 'Scissors' } },
        ]
      }
    }
  ]
)
</code></pre>

<p>Psuedocode</p>

<pre><code>if playerOne == id
  playerThrew = playerOneThrows
else if playerTwo == id
  playerThrew = playerTwoThrows

switch playerThrew {
  case 'rock':
    rockCount++
    break
  case 'paper':
    paperCount++
    break
  case 'scissors':
    scissorsCount++
    break
}

return {
  player_id: id,
  rock: rockCount,
  paper: paperCount,
  scissors: scissorCount
}
</code></pre>

<p>Any insight would be appreciated.</p>

