How to update boolean in MongoDB<p>I have a <code>boolean</code> that I need to update in <code>mongoDB</code> depending on if the user/restaurant is active or not. Is there any way to do this? this is what I have so far</p>

<p><strong>The Schema - simplified</strong></p>

<pre><code>const ownerSchema = new Schema({
  name: { type: String, required: true },
  foodType: { type: String, required: true },
  location: { type: Array, default: [] },

  active: { type: Boolean, default: false },
});
</code></pre>

<p><strong>And the controller:</strong></p>

<pre><code>  isActive: function(req, res) {
console.log(req.body);
db.Owners.updateOne({ _id: req.params.id })
  .then(dbModel =&gt; res.json(dbModel))
  .catch(err =&gt; res.status(422).json(err));
 },
</code></pre>

<p>I just need an easy way to change it to true and false. Any help would be appreciated!</p>

